//Adds final objects, calls FillBoxes, adds names, adds second page and adds cantrips/spells
//Outputs as downloadable blob for PDF
function finishSheet(){
    fillBoxes();
    doc.rect(0,0,260,50)
        .opacity(40);
    doc.fillAndStroke('white')
    doc.image('data:image/png;base64,',50,0,{width:170})
    doc.addPage()
    doc.image('data:image/jpeg;base64,',0,0,{scale:.44, align:'center',valign:'top'})
    doc.fontSize(14)
    doc.text("Sorcerer, Draconic Bloodline",50,70)
    doc.text("Cha",305,65)
    doc.text("13",405,65)
    doc.text("+5",510,65,{
        width:100
    })
    doc.text("Acid Splash\nFireBolt\nMage Hand\nRay of Frost\n",34,176,{
        width:150
    });
    doc.text("Thunderwave\nShield\n",41,347,{
        width:150
    })

    doc.end();
    stream.on('finish', function() {
        var url = this.toBlobURL();
        window.open(url);
});

    
}
